import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import "./Expenses.css";

const Expenses = (props) => {
  let expenseItems = [];
  props.items.map((expense, key) =>
    expenseItems.push(
      <ExpenseItem
        key={key}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    )
  );

  return <Card className="expenses">{expenseItems}</Card>;
};

export default Expenses;
